import React from 'react';
import './Quote.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Quote view Compoennt 
export default function REturnQuOte() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-quote-region p', 1, { delay: 1.2, opacity: 0, y: 20, ease: Expo.easeIn });
 }, []);

 return (
  <div className='wrp-quote-region'>
   <p>lorem Convey meaning 3 through color. Out of the all colors in the Materia</p>
  </div>
 )
}
export const ScreenSmall = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-quote-region-sm p', 1, { delay: 1.2, opacity: 0, y: 20, ease: Expo.easeIn });
 }, []);

 return (
  <div className='wrp-quote-region-sm'>
   <p>lorem Convey meaning through color. Out of the all colors in the Materia</p>
  </div>
 )
};


export const ViewText = () => (
 <p></p>
)
